import React, {useState, useEffect} from 'react';
import {withRouter} from "react-router-dom";
import ProductList from "../components/product/ProductList";
import sampleProducts from "../components/product/sample.js";
import {listProducts} from "../apis/product";



function Products(props) {

  const[products, setProducts] = useState([]);

  useEffect(() => {
    listProducts({}).then((ps)=>{
      console.log("listProducts: ", ps);
      setProducts(ps);
    });
  });

  return (
    <div className="products">
      <h1 className="title">Products</h1>
      <div className="subtitle">24 - product items</div>

      <div>
        <ProductList
          items={products}
          onItemClick={(item)=>{
            props.history.push(`/product/${item.id}`);
          }}
        />
      </div>
    </div>
  );
}

export default withRouter(Products);
